async function convertHtmlToPdf(htmlContent, outputPath) {
  const browser = await puppeteer.launch({ headless: true, args: ['--no-sandbox'] });
  const page = await browser.newPage();
  await page.setContent(htmlContent);
  const resolvedPath = path.resolve(outputPath); // Resolve the output path

  await page.pdf({
    path: resolvedPath,
    width: '200mm',
    height: '300mm',
    printBackground: true,
    margin: {
      //top: headerHeight,
      //bottom: footerHeight,
      // Optionally, you can set left and right margins as well
      // left: '1cm',
      // right: '1cm',
    },
    preferCSSPageSize: true,
    // headerTemplate: `<div style="height: ${headerHeight};"></div>`,
    // footerTemplate: `<div style="height: ${footerHeight};"></div>`,
  });

  await browser.close();
  console.log(`PDF saved at ${resolvedPath}`);
}

async function modifyPdfDimensions(inputPath, outputPath, customWidth, customHeight) {
  const existingPdfBytes = fs.readFileSync(inputPath);
  const pdfDoc = await PDFDocument.load(existingPdfBytes);
  const [page] = pdfDoc.getPages();

  page.setSize(customWidth, customHeight);

  const modifiedPdfBytes = await pdfDoc.save();
  fs.writeFileSync(outputPath, modifiedPdfBytes);
  console.log(`Modified PDF saved at ${outputPath}`);
}

